    <style>
        /* The Modal (background) */
        
        .modal {
            display: none;
            /* Hidden by default */
            position: fixed;
            /* Stay in place */
            z-index: 1;
            /* Sit on top */
            padding-top: 100px;
            /* Location of the box */
            left: 0;
            top: 0;
            width: 100%;
            /* Full width */
            height: 100%;
            /* Full height */
            overflow: auto;
            /* Enable scroll if needed */
            background-color: rgb(0, 0, 0);
            /* Fallback color */
            background-color: rgba(0, 0, 0, 0.4);
            /* Black w/ opacity */
        }
        /* Modal Content */
        
        .modal-content {
            position: relative;
            background-color: #333333;
            margin: auto;
            padding: 0;
            border: 1px solid #888;
            width: 50%;
            box-shadow: 0 4px 8px 0 rgba(0, 0, 0, 0.2), 0 6px 20px 0 rgba(0, 0, 0, 0.19);
            -webkit-animation-name: animatetop;
            -webkit-animation-duration: 0.4s;
            animation-name: animatetop;
            animation-duration: 0.4s
        }
        /* Add Animation */
        
        @-webkit-keyframes animatetop {
            from {
                top: -300px;
                opacity: 0
            }
            to {
                top: 0;
                opacity: 1
            }
        }
        
        @keyframes animatetop {
            from {
                top: -300px;
                opacity: 0
            }
            to {
                top: 0;
                opacity: 1
            }
        }
        
        @-webkit-keyframes animatebottom {
            from {
                top: 0;
                opacity: 1
            }
            to {
                top: -300px;
                opacity: 0
            }
        }
        
        @keyframes animatebottom {
            from {
                top: 0;
                opacity: 1
            }
            to {
                top: -300px;
                opacity: 0
            }
        }
        
        @-webkit-keyframes animatetop2 {
            from {
                left: 95.5%;
            }
            to {
                left: 75%;
            }
        }
        
        @keyframes animatetop2 {
            from {
                left: 95.5%;
            }
            to {
                left: 75%;
            }
        }
        
        @-webkit-keyframes animatebottom2 {

                left: 75%;
            }
            to {
                left: 95.5%;
            }
        }
        
        @keyframes animatebottom2 {
            from {
                left: 75%;
            }
            to {
                left: 95.5%;
            }
        }
        
        @-webkit-keyframes animatetop3 {
            from {
                left: 97.5%;
            }
            to {
                left: 77.5%;
            }
        }
        
        @keyframes animatetop3 {
            from {
                left: 97.5%;
            }
            to {
                left: 77.5%;
            }
        }

            }
        }
